INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (0.0, "2030/01/01 14:59:59", 130211, 100, 0.0, 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", "2024/10/31 12:00:00", 3002100, 3002, 1, -416.5);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (0.0, "2030/01/01 14:59:59", 130211, 101, 0.0, 1, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", "2024/10/31 12:00:00", 3002101, 3002, 1, -416.5);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (8.53, "2030/01/01 14:59:59", 130211, 102, 0.0, 5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", "2024/10/31 12:00:00", 3002102, 3002, 2, -416.5);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (5.67, "2030/01/01 14:59:59", 130211, 103, 0.0, 7, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", "2024/10/31 12:00:00", 3002103, 3002, 1, -416.5);
