INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (0.0, "2030/01/01 14:59:59", 130211, 301, 0.0, 7, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ", "2024/10/31 12:00:00", 3002400, 3005, 7, -416.5);
